import React from 'react';
import {
  Container,
  TextTitle,
  Center
} from './style.js';
import map from '../../assets/mapworld.png';

function LandingPage() {
  return (
    <Container>
      <TextTitle>
        <span className="textshadow">Reach Us</span>
        <div/>
      </TextTitle>
      <Center>
        <img src={map} alt="map"/>
      </Center>
    </Container>
  );
}

export default LandingPage;
